import React from 'react';

const Messages = ({ messages }) => (
  <div className="messages">
    <h3>Messages</h3>
    <ul>
      {messages.map((message, index) => (
        <li key={index}>{message}</li>
      ))}
    </ul>
  </div>
);

export default Messages;
